import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import React from 'react';

function App() {
  return (
    <Router>
      <div>
        <Routes>
          <Route exact path="/" component={Home} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
